import React from "react";

export default function Skill(props) {
    return (
        <div className="skill">
            <img className="skill-img" src={props.img} alt="skill image"/>
            <span className="skill-name">{props.name}</span>
            <div className="rating">{props.rating}</div>
        </div>
    )
}
